import React from 'react';
import { StyleSheet, Text, View, ScrollView, Image, TouchableOpacity, Platform } from 'react-native';

export default function App() {
  return (
    <ScrollView contentContainerStyle={styles.container}>
      {/* Header */}
      <View style={styles.header}>
        <Image source={require('./assets/logo.png')} style={styles.logo} />
        <View style={styles.nav}>
          <Text style={styles.navItem}>Inicio</Text>
          <Text style={styles.navItem}>Servicios</Text>
          <Text style={styles.navItem}>Cómo Funciona</Text>
          <Text style={styles.navItem}>Contacto</Text>
        </View>
      </View>

      {/* Hero Section */}
      <View style={styles.hero}>
        <Text style={styles.heroTitle}>Encuentra profesionales confiables para tus tareas del hogar</Text>
        <Text style={styles.heroSubtitle}>Registra tu solicitud, recibe hasta 4 presupuestos y contrata al mejor profesional</Text>
        <TouchableOpacity style={styles.ctaButton}>
          <Text style={styles.ctaText}>Solicita tu presupuesto ahora</Text>
        </TouchableOpacity>
      </View>

      {/* Cómo Funciona */}
      <View style={styles.section}>
        <Text style={styles.sectionTitle}>¿Cómo funciona Laburo?</Text>
        <View style={styles.steps}>
          <View style={styles.step}>
            <Text style={styles.stepNumber}>1</Text>
            <Text style={styles.stepText}>Registra tu solicitud</Text>
          </View>
          <View style={styles.step}>
            <Text style={styles.stepNumber}>2</Text>
            <Text style={styles.stepText}>Recibe presupuestos</Text>
          </View>
          <View style={styles.step}>
            <Text style={styles.stepNumber}>3</Text>
            <Text style={styles.stepText}>Contrata al mejor</Text>
          </View>
        </View>
      </View>

      {/* Servicios Destacados */}
      <View style={styles.section}>
        <Text style={styles.sectionTitle}>Servicios populares</Text>
        <View style={styles.services}>
          <View style={styles.service}>
            <Image source={require('./assets/albanil.png')} style={styles.serviceIcon} />
            <Text style={styles.serviceText}>Albañil</Text>
          </View>
          <View style={styles.service}>
            <Image source={require('./assets/pintor.png')} style={styles.serviceIcon} />
            <Text style={styles.serviceText}>Pintor</Text>
          </View>
          <View style={styles.service}>
            <Image source={require('./assets/electricista.png')} style={styles.serviceIcon} />
            <Text style={styles.serviceText}>Electricista</Text>
          </View>
        </View>
      </View>

      {/* Testimonios */}
      <View style={styles.section}>
        <Text style={styles.sectionTitle}>Lo que dicen nuestros clientes</Text>
        <View style={styles.testimonials}>
          <View style={styles.testimonial}>
            <Text style={styles.testimonialText}>"Excelente servicio, muy profesionales."</Text>
            <Text style={styles.testimonialAuthor}>- María G.</Text>
          </View>
          <View style={styles.testimonial}>
            <Text style={styles.testimonialText}>"Rápidos y eficientes, los recomiendo."</Text>
            <Text style={styles.testimonialAuthor}>- Juan P.</Text>
          </View>
        </View>
      </View>

      {/* Footer */}
      <View style={styles.footer}>
        <Text style={styles.footerText}>© 2023 Laburo. Todos los derechos reservados.</Text>
        <Text style={styles.footerText}>Contacto: info@laburo.com</Text>
      </View>
    </ScrollView>
  );
}

const styles = StyleSheet.create({
  container: {
    flexGrow: 1,
    backgroundColor: '#fff',
    paddingVertical: 20,
  },
  header: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
    paddingHorizontal: 16,
    marginBottom: 20,
  },
  logo: {
    width: 100,
    height: 40,
    resizeMode: 'contain',
  },
  nav: {
    flexDirection: 'row',
    gap: 20,
  },
  navItem: {
    fontSize: 16,
    color: '#333',
  },
  hero: {
    paddingHorizontal: 16,
    marginBottom: 40,
  },
  heroTitle: {
    fontSize: 28,
    fontWeight: 'bold',
    marginBottom: 10,
    textAlign: 'center',
  },
  heroSubtitle: {
    fontSize: 16,
    color: '#666',
    textAlign: 'center',
    marginBottom: 20,
  },
  ctaButton: {
    backgroundColor: '#007BFF',
    padding: 15,
    borderRadius: 8,
    alignItems: 'center',
  },
  ctaText: {
    color: '#fff',
    fontSize: 18,
    fontWeight: 'bold',
  },
  section: {
    paddingHorizontal: 16,
    marginBottom: 40,
  },
  sectionTitle: {
    fontSize: 24,
    fontWeight: 'bold',
    marginBottom: 20,
    textAlign: 'center',
  },
  steps: {
    flexDirection: 'row',
    justifyContent: 'space-between',
  },
  step: {
    alignItems: 'center',
    flex: 1,
  },
  stepNumber: {
    fontSize: 24,
    fontWeight: 'bold',
    color: '#007BFF',
  },
  stepText: {
    fontSize: 16,
    color: '#333',
    textAlign: 'center',
  },
  services: {
    flexDirection: 'row',
    justifyContent: 'space-between',
  },
  service: {
    alignItems: 'center',
    flex: 1,
  },
  serviceIcon: {
    width: 50,
    height: 50,
    marginBottom: 10,
  },
  serviceText: {
    fontSize: 16,
    color: '#333',
  },
  testimonials: {
    flexDirection: 'row',
    justifyContent: 'space-between',
  },
  testimonial: {
    flex: 1,
    padding: 16,
    backgroundColor: '#f9f9f9',
    borderRadius: 8,
    marginHorizontal: 8,
  },
  testimonialText: {
    fontSize: 16,
    color: '#333',
    marginBottom: 10,
  },
  testimonialAuthor: {
    fontSize: 14,
    color: '#666',
    textAlign: 'right',
  },
  footer: {
    padding: 16,
    backgroundColor: '#f1f1f1',
    alignItems: 'center',
  },
  footerText: {
    fontSize: 14,
    color: '#666',
  },
});
